e full advantage of %s.'=>'Situs Anda akan kembali normal, tapi tidak sepenuhnya mengambil kelebihan dari %s.',' We estimate this will take less than a minute.'=>' Kami perkirakan ini akan berlangsung kurang dari semenit.',' We estimate this will take a couple of minutes.'=>' Kami perkirakan ini akan berlangsung beberapa menit.','%1$sRun the indexation process on your server%2$s using %3$sWP CLI%2$s.'=>'%1$sMenjalankan proses pengindeksan di server Anda%2$s menggunakan %3$sWP CLI%2$s',' We estimate this could take a long time, due to the size of your site. As an alternative to waiting, you could:'=>' Kami perkirakan ini dapat berlangsung lama, berdasarkan ukuran situs Anda. Sebagai alternatif untuk menunggu, Anda sebaiknya:','Please read %1$sthis help article%2$s to find out how to resolve this problem.'=>'Harap baca %1$sartikel bantuan ini%2$s untuk menemukan solusi tentang masalah ini.','Term hierarchy'=>'Hirarki term','Replaced with the term ancestors hierarchy'=>'Ganti dengan hirarki term induk','This %1$s REST API endpoint gives you all the metadata you need for a specific URL. This will make it very easy for headless WordPress sites to use %1$s for all their SEO meta output.'=>'Endpoint REST API %1$s memberikan semua meta data yang Anda butuhkan untuk URL khusus. Sehingga memudahkan situs web WordPress yang headless menggunakan %1$s untuk semua meta SEO yang dihasilkan.','REST API: Head endpoint'=>'REST API: Head endpoint','Your permalink structure includes the post name'=>'Struktur permalink Anda memuat nama artikel','You should change the default WordPress tagline'=>'Anda sebaiknya mengubah slogan bawaan WordPress','You changed the default WordPress tagline'=>'Anda telah mengubah slogan bawaan WordPress','You still have the default WordPress tagline. Even an empty one is probably better.'=>'Anda masih menggunakan slogan bawaan WordPress. Slogan yang kosong mungkin lebih baik daripada menggunakan slogan bawaan.','%1$sYou can change the tagline in the customizer%2$s.'=>'%1$sAnda dapat mengubah slogan situs di menu Tampilan - Sesuaikan%2$s.','You are using a custom tagline or an empty one.'=>'Anda menggunakan slogan baru atau masih kosong.','Comments on your posts are displayed on a single page. This is just like we\'d suggest it. You\'re doing well!'=>'Komentar dari artikel Anda ditampilkan dalam satu halaman. Ini sudah sesuai dengan yang kami sarankan. Bagus!','It\'s highly recommended to have your postname in the URL of your posts and pages. Consider setting your permalink structure to %s.'=>'Sangat disarankan agar judul artikel Anda termuat juga dalam URL artikel dan laman. Pertimbangkan untuk membuat struktur permalink Anda menjadi %s.','You do have your postname in the URL of your posts and pages.'=>'Anda memasukkan judul artikel dalam URL artikel dan laman Anda.','You do not have your postname in the URL of your posts and pages'=>'Nama artikel tidak terdapat pada URL artikel dan laman','Comments on your posts break into multiple pages. As this is not needed in 999 out of 1000 cases, we recommend you disable it. To fix this, uncheck "Break comments into pages..." on the Discussion Settings page.'=>'Komentar dari artikel Anda terpisah menjadi beberapa halaman. Karena ini tidak begitu diperlukan dalam 999 dari 1000 kasus, kami menyarankan untuk tidak memisahnya. Untuk memperbaiki hal ini, hilangkan centang pada "Bagi komentar ke dalam halaman-halaman" pada laman Pengaturan Diskusi.','Comments are displayed on a single page'=>'Komentar-komentar ditampilkan pada satu halaman','Comments break into multiple pages'=>'Komentar-komentar ditampilkan pada beberapa halaman','No title'=>'Tidak ada judul','%1$sGo to the Discussion Settings page%2$s'=>'%1$sKunjungi laman Pengaturan Diskusi%2$s','%1$sThis was reported by the %2$s plugin%3$s'=>'%1$sIni dilaporkan oleh plugin %2$s%3$s','The browser you are currently using is unfortunately rather dated. Since we strive to give you the best experience possible, we no longer support thi